import React from "react"

function Conditional(props){
    let loading=""
    if(props.isLoading === true){
        loading="Loading..."
    }else{
        loading="Page is load."
    }
    return(
        <div>
            <h1>
                {loading}
            </h1>
        </div>
    )
}

export default Conditional
